import React from "react";
import Form from "./components/Form";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0
    }
  }

  handleIncrement = () => {
    this.setState(prevState => {
      return {
        count: prevState.count + 1
      }
    })
  }

  render() {
    return (
      <>
        <h1>Hi</h1>
        <h1>{this.state.count}</h1>
      </>
    )
  }
}

export default App;
